import { Injectable } from '@angular/core';
import { User } from './model/user';

@Injectable({
  providedIn: 'root'
})
export class UserService {
  private nextId = 1;
   users: User[] = [
    { id: this.nextId++, firstName: 'Denis', lastName: 'LN_Test1'},
    { id: this.nextId++, firstName: 'Guillaume', lastName: 'Venier'}
  ];

  getUsers(): User[] {
    return this.users;
  }

  addUser(user: User): void {
    user.id = this.nextId++;
    this.users.push(user);
  }

  deleteUser(user: User): void {
    const index = this.users.findIndex(u => u.id === user.id);
    if (index >= 0) {
      this.users.splice(index, 1);
    }
  }

  setName(firstName: string, lastName: string): void {
    firstName = firstName;
    lastName = lastName;
  }

  getNextId(): number {
      return this.nextId;
  }
}
